import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Accordion, Card, Button} from 'react-bootstrap';
import CardsContentJSON1 from './sCards.json';
const jsonArr1 = JSON.stringify(CardsContentJSON1.CardsContent);
class clServices extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        let jsnCntNum = this.props.cntNum + 2;
        return (
            <Card>
                <Card.Header>
                    <Accordion.Toggle as={Button} variant="link" eventKey={this.props.keyNum}>
                        {jsonArr1.split('"')[`${this.props.cntNum}`]}
                    </Accordion.Toggle>
                </Card.Header>
                <Accordion.Collapse eventKey={this.props.keyNum}>
                    <Card.Body>{jsonArr1.split('"')[`${jsnCntNum}`]}</Card.Body>
                </Accordion.Collapse>
            </Card>
        );
    }
}


export default clServices;
